import React , { useState } from 'react'


export default function Calculator(props) {
    const [inp1, setInp1]=useState(0)
    const [inp2, setInp2]=useState(1)

    function oneInp(){
        setInp1(inp1.target.value)
    }
    return (
        <div className="section calc">
            <p className="fs-14">Calculator:</p>
            <label>{props.symbol}:</label><input value={inp1} onChange={oneInp} className="tokeninp m-b-15"></input>
            <br/>
            <label>USD:</label><input value={inp2} onChange={setInp2} className="tokeninp"></input>
        </div>
    )
}
